DROP TABLE `Student_Table`;

CREATE TABLE `Student_Table` (
  `id` mediumint(8) unsigned NOT NULL auto_increment,
  `ID` mediumint default NULL,
  `name` varchar(255) default NULL,
  `city` varchar(255) default NULL,
  `gender` varchar(255) default NULL,
  `height` mediumint default NULL,
  `c1` mediumint default NULL,
  `c2` mediumint default NULL,
  `c3` mediumint default NULL,
  `c4` mediumint default NULL,
  `c5` mediumint default NULL,
  `c6` mediumint default NULL,
  `c7` mediumint default NULL,
  `c8` mediumint default NULL,
  `c9` mediumint default NULL,
  `c10` mediumint default NULL,
  `constitution` varchar(255) default NULL,
  PRIMARY KEY (`id`)
) AUTO_INCREMENT=1;

